import React from 'react';

import Keep from './static/keep.png'


const Nav = () => {
    return (
        <>
            <div id="navBar">
                <h1>Jarviz Corporation</h1>
                <div>
                    <li>Home</li>
                    <li>Services</li>
                    <li>About</li>
                    <li>Contact-US</li>
                </div>
            </div>

        </>
    )
}

export default Nav;
